import React from "react";
import { NativeBaseProvider, extendTheme } from "native-base";
import Navigation from "./Navigation";

export default function App() {
  const customeColor = {
    primary: {
      50: "#fff1f2",
      100: "#ffe4e6",
      200: "#fecdd3",
      300: "#fda4af",
      400: "#fb7185",
      500: "#f43f5e",
      600: "#e11d48",
      700: "#be123c",
      800: "#9f1239",
      900: "#881337",
    },
    amber: {
      400: "#db2777",
    },
  };

  const theme = extendTheme({
    colors: customeColor,
  });
  return (
    <NativeBaseProvider theme={theme}>
      <Navigation />
    </NativeBaseProvider>
  );
}
